import { Card, Button, Container } from "react-bootstrap";

export default function Course(props) {
  const handleClick = () => {
    alert(`You selected: ${props.title} - ${props.price}`)
  }
  return (
    <>
      <Card style={{ width: "18rem" }}>
        <Card.Img variant="top" src={props.img}/>
        <Card.Body>
          <Card.Title>{props.title}</Card.Title>
          <Card.Text>
              {props.price}
          </Card.Text>
          <Button variant="primary" onClick={() => handleClick()}>Get Course</Button>
        </Card.Body>
      </Card>
    </>
  );
  
}
